DELIMITER $$
--
-- Procedures
--
DROP PROCEDURE IF EXISTS `sp_create_temp_skill_table`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_create_temp_skill_table`(IN `armorSet` VARCHAR(20), IN `typeFilterId` INT(5))
BEGIN
	DELETE FROM temp_skill_table;
	DELETE FROM temp_skill_table_output;
	DELETE FROM temp_skill_table_final;
 
	SELECT distinct st.skillTreeId
	, st.name 
	FROM armorstats a
		JOIN itemtoskilltree itst ON a.itemId=itst.itemId
		JOIN skilltree st ON itst.skillTreeId=st.skillTreeId
	WHERE a.armorSet like armorSet
		AND a.hunterTypeId=typeFilterId;

	SELECT a.equipSlot setPiece, itst.pointValue points, itst.skillTreeId
	FROM armorstats a
		JOIN itemtoskilltree itst ON a.itemId=itst.itemId
	WHERE a.armorSet like armorSet
		AND a.hunterTypeId=typeFilterId;
		
	SELECT tsto.skillTreeId, tst.name, 
	SUM(
		CASE
			WHEN tsto.setPiece='Head'
			THEN tsto.points
			ELSE 0
		END
	) AS 'head',
	SUM(
		CASE
			WHEN tsto.setPiece='Body'
			THEN tsto.points
			ELSE 0
		END
	) AS 'body',
	SUM(
		CASE
			WHEN tsto.setPiece='Arms'
			THEN tsto.points
			ELSE 0
		END
	) AS 'arms',
	SUM(
		CASE
			WHEN tsto.setPiece='Waist'
			THEN tsto.points
			ELSE 0
		END
	) AS 'waist',
	SUM(
		CASE
			WHEN tsto.setPiece='Legs'
			THEN tsto.points
			ELSE 0
		END
	) AS 'legs'
	FROM `temp_skill_table` tst JOIN temp_skill_table_output tsto on tst.skilltreeid=tsto.skilltreeid
	GROUP BY tsto.skillTreeId, tst.name;
    
END$$

DELIMITER ;

